// Confidence level of the proxy detection. If a proxy is not detected, confidence is "high". If it's
// detected, can be "low", "medium", or "high".
// Ref: #/components/schemas/ProxyConfidence
type ProxyConfidence string

const (
	ProxyConfidenceLow    ProxyConfidence = "low"
	ProxyConfidenceMedium ProxyConfidence = "medium"
	ProxyConfidenceHigh   ProxyConfidence = "high"
)

// AllValues returns all ProxyConfidence values.
func (ProxyConfidence) AllValues() []ProxyConfidence {
	return []ProxyConfidence{
		ProxyConfidenceLow,
		ProxyConfidenceMedium,
		ProxyConfidenceHigh,
	}
}

// MarshalText implements encoding.TextMarshaler.
func (s ProxyConfidence) MarshalText() ([]byte, error) {
	switch s {
	case ProxyConfidenceLow:
		return []byte(s), nil
	case ProxyConfidenceMedium:
		return []byte(s), nil
	case ProxyConfidenceHigh:
		return []byte(s), nil
	default:
		return nil, errors.Errorf("invalid value: %q", s)
	}
}

// UnmarshalText implements encoding.TextUnmarshaler.
func (s *ProxyConfidence) UnmarshalText(data []byte) error {
	switch ProxyConfidence(data) {
	case ProxyConfidenceLow:
		*s = ProxyConfidenceLow
		return nil
	case ProxyConfidenceMedium:
		*s = ProxyConfidenceMedium
		return nil
	case ProxyConfidenceHigh:
		*s = ProxyConfidenceHigh
		return nil
	default:
		return errors.Errorf("invalid value: %q", data)
	}
}

