// A confidence rating for the VPN detection result — "low", "medium", or "high". Depends on the
// combination of results returned from all VPN detection methods.
// Ref: #/components/schemas/VpnConfidence
type VpnConfidence string

const (
	VpnConfidenceLow    VpnConfidence = "low"
	VpnConfidenceMedium VpnConfidence = "medium"
	VpnConfidenceHigh   VpnConfidence = "high"
)

// AllValues returns all VpnConfidence values.
func (VpnConfidence) AllValues() []VpnConfidence {
	return []VpnConfidence{
		VpnConfidenceLow,
		VpnConfidenceMedium,
		VpnConfidenceHigh,
	}
}

// MarshalText implements encoding.TextMarshaler.
func (s VpnConfidence) MarshalText() ([]byte, error) {
	switch s {
	case VpnConfidenceLow:
		return []byte(s), nil
	case VpnConfidenceMedium:
		return []byte(s), nil
	case VpnConfidenceHigh:
		return []byte(s), nil
	default:
		return nil, errors.Errorf("invalid value: %q", s)
	}
}

// UnmarshalText implements encoding.TextUnmarshaler.
func (s *VpnConfidence) UnmarshalText(data []byte) error {
	switch VpnConfidence(data) {
	case VpnConfidenceLow:
		*s = VpnConfidenceLow
		return nil
	case VpnConfidenceMedium:
		*s = VpnConfidenceMedium
		return nil
	case VpnConfidenceHigh:
		*s = VpnConfidenceHigh
		return nil
	default:
		return errors.Errorf("invalid value: %q", data)
	}
}

